DROP TABLE IF EXISTS `power_global_user`;
CREATE TABLE `power_global_user` (
  `global_user_id` int(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户编号',
  `global_user_login_name` varchar(100) DEFAULT NULL COMMENT '登录名',
  `global_user_name` varchar(20) DEFAULT NULL COMMENT '用户姓名',
  `global_user_pwd` char(32) DEFAULT NULL COMMENT '用户密码(md5加密)',
  `global_user_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态是否有效，默认有效(0无效,1有效)',
  `global_user_system` text COMMENT '用户和系统对应关系表,json存储格式',
  `global_user_unite_pwd` tinyint(1) NOT NULL COMMENT '密码是否统一,默认统一(1统一，0非统一)',
  `global_user_is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否被删除(1表示删除,0表示未删除)',
  `global_user_job_no` varchar(10) DEFAULT NULL COMMENT '工号',
  `global_user_email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `global_user_phone` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `global_user_company` int(5) unsigned DEFAULT NULL COMMENT '用户所属公司',
  `global_user_dept` int(8) DEFAULT NULL COMMENT '所属部门',
  `global_user_job` int(10) unsigned DEFAULT NULL COMMENT '所属岗位',
  `global_user_sex` tinyint(1) DEFAULT NULL COMMENT '性别(1男,2女)',
  `global_user_graduate_school` varchar(50) DEFAULT NULL COMMENT '毕业学校',
  `global_user_register_time` int(10) NOT NULL COMMENT '注册时间(时间戳存储)',
  `global_user_remark` text COMMENT '用户信息备注',
  `global_user_address` varchar(100) DEFAULT NULL COMMENT '联系地址',
  `global_user_birthday` date DEFAULT NULL COMMENT '出生日期(时间戳存储)',
  `global_user_native_place` varchar(20) DEFAULT NULL COMMENT '籍贯',
  `global_user_qq` varchar(15) DEFAULT NULL COMMENT 'qq',
  `global_user_weixin` varchar(30) DEFAULT NULL COMMENT '微信',
  `global_user_major` varchar(30) DEFAULT NULL COMMENT '所学专业',
  `global_user_education` varchar(10) DEFAULT NULL COMMENT '学历',
  `global_user_degree` varchar(10) DEFAULT NULL COMMENT '学位',
  `global_user_is_marry` tinyint(1) DEFAULT NULL COMMENT '是否结婚(1结婚，0未婚)',
  `global_user_blood_type` varchar(10) DEFAULT NULL COMMENT '血型',
  `global_user_entry_time` int(10) DEFAULT NULL COMMENT '入职时间(时间戳存储)',
  `global_user_dimission_time` int(10) DEFAULT NULL COMMENT '离职时间(时间戳存储)',
  `global_user_id_number` char(18) DEFAULT NULL COMMENT '身份证号码',
  `global_user_id_address` varchar(50) DEFAULT NULL COMMENT '身份证地址',
  `global_user_emergency_contact` varchar(20) DEFAULT NULL COMMENT '紧急联系人',
  `global_user_emergency_contact_phone` varchar(20) DEFAULT NULL COMMENT '紧急联系人电话',
  `global_user_photo_url` varchar(100) DEFAULT NULL COMMENT '照片路径',
  `global_user_job_path` varchar(100) DEFAULT NULL COMMENT '岗位路径',
  `global_user_independence` tinyint(1) DEFAULT '0' COMMENT '权限类别(1单独设置,0全部共享)',
  PRIMARY KEY (`global_user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=939 DEFAULT CHARSET=utf8;

